DROP TABLE means_of_transportation;
DROP TABLE on_road_vehicle;
DROP TABLE population;
DROP TABLE municipality;
CREATE TYPE on_road_vehicle_type AS ENUM(
'combination long-haul truck','combination short-haul truck','intercity bus','light commercial trucks','motor home','motorcycles','passenger cars','passenger trucks','refuse truck','school bus','single unit long-haul truck','single unit short-haul truck','transit bus'
);
CREATE TYPE means_of_transportation_type AS ENUM(
'car, truck, or van','public transport','taxicab','motorcycle','bicycle','walked','other means','worked at home'
);
CREATE TABLE municipality (
MNo SMALLINT,
Name VARCHAR(30),
County VARCHAR(10),
PRIMARY KEY (MNo)
);
CREATE TABLE population (
MNo SMALLINT,
Year SMALLINT,
Pop INT,
CO2 INT,
EVs SMALLINT,
PersonalVehicles INT,
PRIMARY KEY (MNo, Year),
FOREIGN KEY (MNo) REFERENCES municipality (MNo)
);
CREATE TABLE on_road_vehicle (
MNo SMALLINT,
Year SMALLINT,
Type on_road_vehicle_type,
CO2 DECIMAL(8,2),
Miles INT,
PRIMARY KEY (MNo, Year, Type)
);
CREATE TABLE means_of_transportation (
MNo SMALLINT,
Year SMALLINT,
Type means_of_transportation_type,
Percentage DECIMAL(7,3),
PRIMARY KEY (MNo, Year, Type),
FOREIGN KEY (MNo, Year) REFERENCES population (MNo, Year)
);
